		upgrade = "Let's see how strong I've really gotten. Send me into battle!",
		voice_key = 30512,
		headtouch = "",
		feeling2 = "You okay, Commander? You've had this tired, stiff look on you for a while now... You're not getting rusty like Suruga, are you?",
