		feeling4 = "Look, I do appreciate your concern, but you saying that in front of everyone is embarrassing! Could you not put me on the spot like that again? That'd be great!",
		unlock = "Battleship Suruga, reporting for duty. It would seem that some threads of fate connect me to this port... No, don't mind my rambling. Please disregard that.",
		feeling5 = "*Sigh*...! People have their eyes glued to me wherever I go now, thanks to you... There are plenty of other ways to express your love without embarrassing me, you know! Please, Commander, I'd rather not deal with that again!",
		main = "I believe I'm better suited for a desk job where I can analyze data and draft new plans. The reason being my strengths lie in quickly reading, memorizing, and writing documents.|Reckless hotheads and I don't get along particularly well. So I've learned first-hand through bad experiences with a certain someone... That is not to say I hate those kinds of people, however.|I'm deeply grateful that you've elected me as your secretary. However, I would absolutely welcome the addition of more people to the office, as we're rather short-staffed with just me here.|I'm not a fan of battling, but if anyone picks a fight with me, then a fight they'll get. We were made to wage war, and so that is our responsibility.|Life is so peaceful at this port. For that, we can thank the many girls here who I don't hold as much as a candle to.",
		battle = "The Suruga Fleet w-will not disappoint...!",
		upgrade = "It's meaningless to fight if you cannot win. As such, a few enhancements may prove necessary.",
		voice_key = 30514,
		headtouch = "I hope my horns were left alone... Phew, they were... Err, no! Never mind I said anything!",
		feeling2 = "I hope to leverage my meager secretary abilities for the betterment of the fleet. I'm always ready for your orders, Commander.",
