		touch = "Commander, are you able to fathom this majestic outfit that impeccably balances both beauty and dignity?",
		profile = "While I was able to set sail many times during my time both as a submarine tender and as a light carrier, in the end, I was unable to take even a single step away from port... No, nothing will happen if I just sit around like this. As I have stated many times, I, Ryuuhou, will bring you victory!",
