		main = "Comrade, you must always be ready to fight, even in times of peace. If you get complacent with the status quo, then who else will stand up in the event of a crisis?|The Sakura Empire is home to a few drinkers too, I've learned. Ise and Hyuuga, I think their names were? I'll invite them over the next time I'm enjoying some liquor!|Ugh! I've had enough of this! Get up, comrade! We'll round up some more comrades and go for some target practice!",
