	[900133] = {
		feeling1 = "Commander, I'm gonna get angry.",
		feeling3 = "If you’re only going by appearances, every child in this fleet looks cute. But in terms of personality, they all have their unique quirks. To be honest, I am a bit envious of them. (strokes chin).",
		lose = "Not so successful... let's try again next time.",
		propose = "Well, your trust deserves to be rewarded... umm... Commander, do you like bunny girls?~",
		expedition = "The commission is over, they should be back soon~",
		win_mvp = "If the Commander gives me a few praises, then I will be very happy~",
		home = "Ah, hold on, your collar is all messed up. Stand still while I fix it... there you go~ (waves).",
		mission = "It’s not good to leave tasks unfinished.",
		touch2 = "Not good...",
		voice_key_2 = -1,
		skill = "Never let your guard down.",
		drop_descrip = "North Carolina class battleship— North Carolina, hull number BB-55.",
		mail = "You’ve got new mail~",
		touch = "Do you need help with something?",
		profile = "I am North Carolina class ship no.1. I can be considered the big sister battleship of the Eagle Union~ I don’t particularly like or dislike anything, so to speak. Even though I have fought in all kinds of engagements, I have not gained any fame... I am a little bit troubled by this.",
		mission_complete = "The mission rewards were sent out, are you not going to pick it up?",
		feeling4 = "I always believe there is nothing wrong with being ordinary. But after meeting you Commander, I want to change myself a little... after all, my sisters are all so charismatic~ Well.. Commander, are you fond of bunny girls?~",
		unlock = "North Carolina here, awaiting your dispatch. Although I may seem to have a bland personality compared to my sisters. But as the saying goes, no personality is still a personality, hehe. Anyways, awaiting your orders, sir.",
		feeling5 = "Do you want to eat something later Commander? And then you can accompany me to go shopping, if you want to get something then let’s go together. Then... hehe... let’s take a walk in the park? Commander, everywhere I go as long as I’m with you will be just fine~",
		main = "What do I wear inside? It's not something that’s so significant |If I think about it, I certainly have been to many places... seen many landscapes, and also parted ways with many people. |Sometimes I get so envious of my younger sister Washington and how she’s so energetic all the time.",
		battle = "Don’t be overconfident, and try not to be so nervous while focusing on winning~",
		upgrade = "I'll try to work a bit harder~",
		voice_key = -1,
		headtouch = "",
		feeling2 = "Commander remembers me~ Not that I’m boasting or anything, but I still have confidence in my low sense of existence. (smiles wryly)",
		login = "Welcome back~",
		vote = "",
		hp_warning = "Sisters, hold on!",
		id = 900133,
		detail = "Being stared like that makes a bit shy...",
		couple_encourage = {}
	},
	[900134] = {
		feeling1 = "You are too weak, it’s no fun playing with you, go practice some more.",
		feeling3 = "No, no, that’s not right. If we do it this way, won’t it end much the same like in the past? … Don’t try so hard? You sometimes say stuff like that… Hmm? That was a good smile from me just now?",
		lose = "Oh, I will not forget you!",
		propose = "Wait wait! We’re doing “that”, right? Is this your new way of teasing me!... Damn, you bastard, I’m not sure if I should cry or laugh about this...",
		expedition = "Your memory can’t be worse than mine, right? The commission fleet has returned, won’t you go greet them?",
		win_mvp = "Sure enough, I am happiest when all the foes are annihilated~",
		home = "I’m glad that you didn’t get hurt—— What?! I don’t have feelings for you!",
		mission = "A new mission? Haha, now my blood is boiling.",
		touch2 = "...You wish to die? (Smiles)",
		voice_key_2 = -1,
		skill = "Out of my way. I'm ready to fight!",
		drop_descrip = "North Carolina class battleship— Washington, hull number BB-56.",
		mail = "Hey, your mail.",
		touch = "Don’t touch me as if you’re trying to be intimate with me.",
		profile = "North Carolina class ship no. 2. I am Washington! The thing I like to do the most is to destroy my enemies. Recently, I am practicing on my smile. —— Battle record? I don’t really show off with such things, all in all, how’s my smile?",
		mission_complete = "Go grab the reward yourself, I’m not interested.",
		feeling4 = "Lately, my smile has become more natural? Emm, huh (scratches head), I was recently trying to find a new hobby. While I was searching, I realized that being with you is not so bad… (whispers)",
		unlock = "Hello, Commander, I am Washington... my sister told me that I cannot be so rough once I join the fleet, so I am practicing my smile. Darn, why must I listen to her...",
		feeling5 = "I couldn’t help but smile when I saw you, this is the first time that I’m feeling this way... although, I also have other feelings rushing towards me. I suddenly want to see your expression when you are bullied by me—— Commander, stay with me for a while. (Laughs)",
		main = "My smile looks beautiful? You jerk... oops, keep smiling, keep smiling. Thank you for your compliments. | Hey, that rigid South Dakota is still the same. Commander, you see, I am cuter than her. | A true measurement of friendship is their actions and not their words, I don’t like people who are rhetorical in nature.",
